    false,nt"url": null,nt"notes": "This annual narrative report for National
    Elk Refuge outlines Refuge accomplishments during the 1988 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the management
    plan, compliance with environmental and cultural resource mandates, and research
    and investigations. Refuge administration is outlined; information about personnel,
    youth programs, other manpower programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, fire management, pest control, and water rights. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh and water birds, shorebirds, raptors, game mammals, other resident wildlife,
    fisheries resources, and disease prevention and control. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, wildlife observation, other wildlife oriented recreation, picnicking,
    other non-wildlife oriented recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, and energy conservation.
    A summary of Yellowstone wildfires is also included. Photographs and brochures are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
